  \"2015-01-22T15:57:38.086700\",\n\t\"name\": \"fy11-coc-awards\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report displays the renewal homeless
  assistance projects being awarded by HUD under the 2011 Continuum of Care (CoC)
  competitive grants process. Approximately $1.47 billion ($1,473,690,179) is being
  awarded for renewal competitive programs. The competitive programs provide funding
  for transitional and permanent housing and supportive services. These reports are
  organized by state and then by continuum, or community. Within each listed continuum
  are the organizations that will be assisted with HUD's awards for competitive programs.\",\n\t\"license_title\":
